INSERT INTO `quid_faq` (`id`, `question`, `answer`) VALUES
(1, 'What are the benefits of taking a personal loan?', 'No, Quid Money follows a no-questions asked policy. You do not need to disclose the purpose of the loan and are free to use it for any financial need. You get a diverse range of personal loan options with competitive interest rates. Our streamlined process ensures a fast and convenient application. Transparent terms, credit score improvement, expert guidance, and top-notch security make us the ideal platform for your borrowing needs.'),
(2, 'Are you a Bank or NBFC?', 'Quid is a loan aggregator platform and marketplace that connects finance seekers with RBI-registered NBFCs and lending partners.'),
(3, 'Do I need to disclose why I need a loan?', 'Yes, the minimum tenure is 3 months and maximum being 5 years.No, Quid follows a no-questions asked policy. You need not disclose the purpose of the loan and are free to use it for any financial need.'),
(4, 'How much can I borrow and for how long?', 'You can get personal loans starting from Rs. 3,000 up to Rs.50 lakhs from 3 months  to 5 years.'),
(5, 'Is there any processing fee for the loans?', 'Processing fees may vary depending on the lender and the type of loan you choose. It\'s crucial to carefully review the terms and conditions of each loan offer to understand any associated fees. While some lenders may charge a processing fee, others may not. Our platform provides transparency, and you will be informed about any applicable fees before finalizing your loan application. Additionally, keep in mind that our loan aggregator services are free for users. We do not charge any fees for using our platform to compare and access loan options.'),
(6, 'Can I repay my loan early?', 'Yes, you can prepay your loan as and when you want.'),
(7, 'How does Quid assess my credit worthiness and how long does this take?', 'Each consumer wishing to borrow on the Quid portal will need to go through a verification and credit assessment process. The assessment is based on information collected from data sources like the credit bureaus. The above process is automated and happens within seconds. Hence, you can get an approval shortly after you submit your application.'),
(8, 'Why was my application rejected?', 'The reason your application was rejected was because your credit profile did not match the criteria stipulated in the policy provided by the financial institution at the time. However, the institution might be able to approve your application at a later date, if by then your credit file has improved or there have been changes in the policy.'),
(9, 'What happens in the case of a missed payment or non-payment by a borrower?', 'If you miss a payment or are unable to make a payment on time, it is crucial to communicate directly with your lender as soon as possible. The specific actions taken by the lender in case of missed payments vary and are outlined in the terms and conditions of the loan agreement. Typically, a missed payment may result in late fees or penalties. It can also negatively impact your credit score. Lenders may have policies for addressing late payments, and it\'s essential to be aware of these terms before agreeing to a loan. Continued non-payment could lead to more severe consequences, such as legal action or debt collection procedures. Our platform encourages responsible borrowing.'),
(10, 'What is Annualized Percentage Rate (APR) and how is it different from rate of interest?', ' Interest rate of a loan is defined as the percentage charged on the principal amount given by the lender to the borrower. The Annual Percentage Rate (APR) is a method of computing the annualized cost of credit, which includes both the interest rate and any processing fees associated with the loan. APR indicates the actual cost of borrowing money and is expressed as a percentage. For example, if you apply for a Personal Loan of Rs. 1,00,000 with an interest rate of 12%, tenure of 12 months, and processing fee of Rs. 1000, the APR of the loan is 14%. This means you will be paying back Rs. 1,14,000 at the end of the contracted tenure.'),
(11, 'What information is shared with the lenders browsing through the profiles?', 'Information shared with the lenders includes your personal details such as your name, age, and your credit profile.'),
(12, 'How do I alter my loan request?', 'Loan requests can only be canceled prior to loan disbursal. In case you want to make any changes to your request please reach out to assist@quid.money. The support team will help you in making the modifications.'),
(13, 'How will you disburse the loan amount?', 'Soon after the loan is approved, the funds will be transferred right into your bank account.'),
(14, 'Will I get an approved loan after my application is declined once from the same lender?', 'Yes, you can reapply for a personal loan but only after you make sure that this time you meet all the eligibility criteria set by the lender and also improve your credit score and credit history.'),
(15, 'Any document needed for Student Loan?', 'Yes, typically, students may need to provide proof of enrollment, a valid ID, income information (if applicable), and details about the educational institution. Lenders may have specific document requirements, and it\'s advisable to check with the chosen lender for the exact documentation needed during the loan application process.'),
(16, 'How can I contact the Grievance Officer for assistance or to address any concerns?', 'If you have any concerns or grievances, you can reach out to our grievance officer at legal@quid.money.');
